import React from 'react';
import './Exportpage.css';  // Make sure this path is correct based on your project structure

function Exportpage() {
    return (
        <div className="pagebackground">
            <h1>Export Your Project</h1>
            <p>Your export options will be displayed here.</p>
            {/* Add any additional export functionality or UI elements as needed */}
        </div>
    );
}

export default Exportpage;
